script: |
  super -f text -I q6093.spq | sort > q6093.out

inputs:
  - name: q6093.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN 60 * col2 / - - col1 + + col1 AND - ( + + col2 ) + + - ( col1 ) * col0 * + col1;
  - name: tab2

outputs:
  - name: q6093.out
    data: |
